import React from 'react';
import styled from 'styled-components';
import CarInfoDisplay from './CarInfoDisplay';

const StyledSlideTwo = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;
  scroll-snap-type: y mandatory;
`;

function SlideTwo() {
  // Add the text
  return (
    <StyledSlideTwo>
      <CarInfoDisplay />
    </StyledSlideTwo>
  );
}

export default SlideTwo;
